webpackJsonp([0x69aa95321410],{629:function(e,t){e.exports={data:{allMarkdownRemark:{totalCount:1,edges:[{node:{fields:{slug:"/whats-new-in-javascript"},excerpt:"Last Monday I did my public first talk outside of work life. A short 20 minute presentation on modern JavaScript features at a local .netâ€¦",timeToRead:1,frontmatter:{title:"What's new in JavaScript?",tags:["meetup","personal","javascript"],cover:"https://unsplash.it/1152/300/?random?JavaScript",date:"2016-10-31T14:08"}}}]},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{tag:"meetup",nodes:[{node:{frontmatter:{title:"What's new in JavaScript?",tags:["meetup","personal","javascript"],cover:"https://unsplash.it/1152/300/?random?JavaScript",date:"2016-10-31T14:08",author:"eddie"},fields:{slug:"/whats-new-in-javascript"},html:'<p>Last Monday I did my public first talk outside of work life. A short 20 minute presentation on modern JavaScript features at a local .net developer meet-up - <a href="https://www.meetup.com/dotnetnotts/events/226457574/">dot net notts</a>.</p>\n<p><img src="/images/dotnetnotts.png" alt="Dot Net Notts"></p>\n<p>I had no slides, the talk was comprised of live coding with prepared examples showing off the five areas of ES2015 I think bring the biggest change to the language.</p>\n<ul>\n<li>Variables</li>\n<li>Template Strings</li>\n<li>Arrow Functions</li>\n<li>Spread and Rest</li>\n<li>Generators</li>\n</ul>\n<p>The talk went fairly well, with the forgivingness of JavaScript helping me out on more than one occasion. Hopefully many more of these to come.</p>',timeToRead:1}}],page:1,pages:1,total:1,limit:5}}}});
